// A fullscreen header for the main github portfolio 
// Will contain its own menubar different from the sidebar menu

import React, { useState , useEffect, FC, ReactElement } from 'react';
import { Link } from "react"

// Contains relevant links
interface tabOptions {
    name : string,
    contextmenu? : string,
    // Add more interface options to handle moving the scrollbar to correct point in the page
}

interface HeaderType {
    title : string,
    readMore: string,
    tabs : tabOptions[]
}

const Header : FC<HeaderType> = ({
    title, readMore, tabs
}) : ReactElement => {
    return(
        <div id="HeaderParent">
            <div id="nav">
                <ul id="navul">
                    {tabs.map(tab => (
                        <li className="navLi" id= {["navLi",tab.name].join("-")}>
                            <Link className="navA" id= {["navA",tab.name].join("-")}>
                                {tab.name}
                            </Link>
                        </li>
                    ))}
                </ul>
            </div>
            <div id="siteHeader">
                {title}
            </div>
        </div>
    )
}

export default Header
